here is a function that returns the element "num" in the Fibonacci series in c++, I am still a beginner so feel free to point anything  you see it can be better in the code.

int sumOf(int num, int order){
    int sum = 0;
    int counter = 1;
    if(num < order){return 0;}
    if(num == order){return 1;}
    if (num > order){
        while(counter <= order){
            sum = sum +sumOf(--num, order);
            counter++;
        }
        return sum;
    }
}
